import React from 'react';
import PropTypes from 'prop-types';
import './currentcard.css';

export default function CurrentCard(props) {
	return (
		<div className="current-card-wrapper">
			<div className="current-card-graphic" />
			<div className="current-card-info">
				<span className="current-card-temp">{props.temp}&#176;</span>
				<span className="current-card-weather">{props.weather}</span>
			</div>
		</div>
	);
}

CurrentCard.propTypes = {
	temp: PropTypes.string.isRequired,
	weather: PropTypes.string.isRequired,
	icon: PropTypes.string.isRequired
};
